define({"topics" : [{"title":"Topics Selector","shortdesc":"\n               <p class=\"shortdesc\">The Pulsar Consumer origin can subscribe to a single topic or to multiple topics. In         either case, the origin uses\n                  one thread for the read.\n               </p>\n            ","href":"datacollector\/UserGuide\/Origins\/PulsarConsumer.html#concept_ndm_4bm_y2b","attributes": {"data-id":"concept_ndm_4bm_y2b",},"menu": {"hasChildren":true,},"tocID":"concept_ndm_4bm_y2b-d46e56976","next":"concept_ndm_4bm_y2b-d46e56976",},{"title":"Enabling Security","shortdesc":"\n               <p class=\"shortdesc\">If the Pulsar cluster uses security features, you must configure the Pulsar Consumer         origin to use the same security\n                  features to connect to Pulsar.\n               </p>\n            ","href":"datacollector\/UserGuide\/Origins\/PulsarConsumer.html#task_fsr_wgs_y2b","attributes": {"data-id":"task_fsr_wgs_y2b",},"menu": {"hasChildren":false,},"tocID":"task_fsr_wgs_y2b-d46e57036","topics":[]},{"title":"Offset Management","shortdesc":"\n               <p class=\"shortdesc\">The first time that a Pulsar Consumer origin receives messages from a topic, an         offset entry is created for that subscription\n                  and topic. The offset entry is created and         maintained by Pulsar. \n               </p>\n            ","href":"datacollector\/UserGuide\/Origins\/PulsarConsumer.html#concept_fqm_mjm_y2b","attributes": {"data-id":"concept_fqm_mjm_y2b",},"menu": {"hasChildren":false,},"tocID":"concept_fqm_mjm_y2b-d46e57081","topics":[]},{"title":"Record Header Attributes","shortdesc":"\n               <p class=\"shortdesc\">The Pulsar Consumer origin includes any information in the properties field of the         message - outside of the payload\n                  field - in records as record header attributes. \n               </p>\n            ","href":"datacollector\/UserGuide\/Origins\/PulsarConsumer.html#concept_tvr_r3m_y2b","attributes": {"data-id":"concept_tvr_r3m_y2b",},"menu": {"hasChildren":false,},"tocID":"concept_tvr_r3m_y2b-d46e57136","topics":[]},{"title":"Data Formats","href":"datacollector\/UserGuide\/Origins\/PulsarConsumer.html#concept_cdw_f4m_y2b","attributes": {"data-id":"concept_cdw_f4m_y2b",},"menu": {"hasChildren":false,},"tocID":"concept_cdw_f4m_y2b-d46e57202","topics":[]},{"title":"Configuring a Pulsar Consumer Origin","href":"datacollector\/UserGuide\/Origins\/PulsarConsumer.html#task_kzh_cpc_r2b","attributes": {"data-id":"task_kzh_cpc_r2b",},"menu": {"hasChildren":false,},"tocID":"task_kzh_cpc_r2b-d46e57274","topics":[]}]});